<script>
    export default {
		name:'technicalSupport',
      components: {},
      data() {
        return {};
      },
      methods: {},
      mounted() {
        let footer = $("#svg_footer");
        footer.css("opacity", 0);
        let Interval = setInterval(function () {
            if ($(".loading").is(":visible")) return;
            let win_w = parseInt($(window).width(), 10);
            let win_h = parseInt($(window).height(), 10) * 0.92;
            let svg_h = parseInt(footer.height(), 10);
            $(".container-warp").css("min-height", win_h - svg_h + "px");
            footer.animate({ "opacity": 1 }, 100);
            $(".footer-tip").height($(".footer").height());
            clearInterval(Interval);
        }, 300)
      }
    };
</script>

